listing_description:
A spacious studio unit situated on the 6th floor of the iconic Raffles Plaza with lift acess.  The property enjoys panoramic views over Gardens Park Golf Link, Mindil Beach Casino Resort and the ocean. Other features include:

Fully furnished and equipped;
Good size balcony;
Kitchen with ample cupboard space, ceramic stove top, oven and dishwasher;
Queen size bed;
Dining table with seating for 4 people;
No parking provided (however there is ample parking available at the front of the complex).

Raffles Plaza also has an inground pool for residents use.

Available now

Register your interest online or contact Thrive Property NT on (08) 8911 0741.
